import React from 'react'
import { Box, Grid, Container } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'
import AddressCard from '../../components/addressCard'

const styles = (theme) => ({
    root : {
        marginTop : 20
    },
    addressWrapper : {
        display : "flex",
        flexDirection : "row",
        flexWrap : "wrap",
        justifyContent : "space-between",
        width : "100%",
        height : 500,
        boxShadow : "0px 0px 2px 1px rgba(0,0,0,0.3)",
        borderRadius : 10,
        padding : 30,
        marginTop : 20,
        marginBottom : 20,
        [theme.breakpoints.down('md')] :{
            height : 300,
        },
        [theme.breakpoints.up('md')] :{
            height : 500,
        }
    },
    calculationWrapper : {
        width : "80%",
        height : 500,
        boxShadow : "0px 0px 2px 1px rgba(0,0,0,0.3)",
        borderRadius : 10,
        marginTop : 20,
        marginBottom : 20,
        [theme.breakpoints.between('sm','md')] :{
            width : "100%",
        },
        [theme.breakpoints.down('sm')] :{
            width : "100%",
        },
        [theme.breakpoints.up('md')] :{
            width : "80%",
        }
    },
    calculationBox : {
        display : "flex",
        flexDirection : "row",
        justifyContent : "flex-end"
    }
})

const Order = ({ classes }) => {
    return (<Box className={classes.root}>
        <Container>
            <Grid container direction="row" justify="space-between">
                <Grid item xs={12} sm={12} md={9} lg={9} xl={9} >
                    <Box className={classes.addressWrapper}>
                        <AddressCard />
                        <AddressCard />
                        <AddressCard />
                        <AddressCard />
                        <AddressCard />
                    </Box>
                </Grid>
                <Grid item xs={12} sm={12} md={3} lg={3} xl={3} className={classes.calculationBox}>
                    <Box className={classes.calculationWrapper}>

                    </Box>
                </Grid>
            </Grid>
        </Container>
    </Box>)
}

Order.propTypes = {
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Order)
